import React from "react";

function Members () {
const members = ["Alice", "Bob", "Charlie", "Diana"]; // This could be fetched from an API
  return (
    <div>
      <h2>Members</h2>
      <ul>
        {members.map(member => <li key={member}>{member}</li>)}
      </ul>
    </div>
  );
}

export default Members;
